/* eslint-disable react/no-typos */

import PropTypes from 'prop-types'
const Header = ({title}) => {
    return (
        <header className="header">
            <h1>{title}</h1>
            <button className="btn btn-primary btn-sm m-2">Add</button>
        </header>
    )
}

Header.defaultProps= {
    title: 'Task Tracker',
}

Header.proptypes = {
    title: PropTypes.string.isRequired,
}
export default Header
